pragma solidity ^0.6.0;

import "./IStrategy.sol";

interface ISettings {
    function feeAddress() external view returns (address);
    function txFeePoints() external view returns (uint256);
    function txFeeBasePoints() external view returns (uint256);
    //function maxTxFeePercent() external view returns (uint256);
    function fillerFeePoints() external view returns (uint256);
    function fillerFeeBasePoints() external view returns (uint256);
    //function maxFillerFeePercent() external view returns (uint256);
    function depositFeePoints() external view returns (uint256);
    function depositFeeBasePoints() external view returns (uint256);
    //function maxDepositFeePercent() external view returns (uint256);
    function slippagePoints() external view returns (uint256);
    function slippageBasePoints() external view returns (uint256);
    function controller() external view returns (address);
    function setController(address _controller) external;
    function setFeeAddress(address _feeAddress) external;
    function setTxFee(uint256 _feePoints, uint256 _feeBasePoints) external;
    function setFillerFee(uint256 _feePoints, uint256 _feeBasePoints) external;
    function setDepositFee(uint256 _feePoints, uint256 _feeBasePoints) external;
    function setSlippage(uint256 _slippagePoints, uint256 _slippageBasePoints) external;

    function addVault(address _vault) external;
    function deactivateVault(address _vault) external;
    function vault(address _vault) external view returns (bool);
    function setStrategy(address _token, IStrategy _strategy) external;
    function strategy(address _token) external view returns (IStrategy);
}
